import React, { Component } from 'react';
import { StyleSheet, View, Text, TouchableOpacity, ActivityIndicator, Image, SafeAreaView, ScrollView, NatvigationsEvents } from 'react-native';

import Icon from 'react-native-vector-icons/Feather';

export default class Feed extends React.Component {
    static navigationOptions = {
        title: 'Feed',
    }

    constructor(props) {
        super(props);
        this.state = {
            isLoading: true,
            post: [],
        }
        this.getItems();
    }


    getItems() { 
        fetch('http://localhost:3000/view/listar.php');
            then((response) => {console.log("response", response.json())} ) 
            .then((responseJson) => {
                console.log();
                this.setState({
                    isLoading: false,
                    post: responseJson,
                });
            }).catch((error) => {
                alert(error);
            });
        }


    render(){
        return(
            <View>
                <Text>Feed</Text>
            </View>
        );
    }
}

const styles = StyleSheet.create({
    tamanho_foto_perfil: {
        height: 50,
        width: 50,
        borderRadius: 100
    },

    titulo_livro: {
        fontSize: 16,
        fontWeight: 'bold',
    },

    autor_livro: {
        fontSize: 12,
        paddingLeft: 6
    },

    tamanho_imagem_livro: {
        height: 310,
        width: '100%',

    },

    header_post: {
        flexDirection: 'row',
        alignItems: 'center',
        paddingTop: 16,
        paddingBottom: 10,
        marginHorizontal: 8,

    },

    line: {
        padding: 0.4,
        width: '100%',
        backgroundColor: '#F1F2F2',
    },

    adicionar_livro: {
        marginTop: 12,
        borderRadius: 100,
        backgroundColor: '#2398AB',
        padding: 20,
        fontSize: 20,
        alignSelf: 'center',
        color: 'white'
    },

})
